query QueryRenderersCitySectionListQuery(
  $citySlug: String!
) {
  city(slug: $citySlug) {
    ...CitySectionList_city
  }
}

fragment CitySectionList_city on City {
  name
  shows(discoverable: true, first: 10, sort: START_AT_ASC, after: "") {
    edges {
      node {
        id
        _id
        __id
        is_followed
        start_at
        end_at
        status
        href
        type
        partner {
          __typename
          ... on Partner {
            name
            type
          }
          ... on ExternalPartner {
            name
            __id
          }
          ... on Node {
            __id
          }
        }
        __typename
      }
      cursor
    }
    pageInfo {
      endCursor
      hasNextPage
    }
  }
}
